import logo from './logo.svg';
import './App.css';
import {Nav, Navbar,Container,Button} from 'react-bootstrap';
import insta from './assets/insta.png';
import whatsapp from "./assets/whatsapp.png";
import linkedin from "./assets/in.png";


function App() {
  return (
    <>
    <Navbar expand="lg">
      <Container>
      <span>Let's Connect</span>
        <Navbar.Toggle aria-controls="basic-navbar-nav">
          <span className='navbar-toggler-icon'></span>
        </Navbar.Toggle>
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home"><b>Home</b></Nav.Link>
            <Nav.Link href="#skills"><b>Skills</b></Nav.Link>
            <Nav.Link href="#projects"><b>Projects</b></Nav.Link>
          </Nav>
          <span className='navbar-text'>
            <div className='social-icon'>
             <a  href='#'><img id='insta' src={insta} alt="instagram icon"/></a>&nbsp;&nbsp;&nbsp;&nbsp;
             <a href='#'><img id='linkedin' src={linkedin} alt="linkedin icon"/></a>&nbsp;&nbsp;&nbsp;&nbsp;
             <a href='#'><img id='whatsapp' src={whatsapp} alt="whatsapp icon"/></a>&nbsp;&nbsp;&nbsp;&nbsp;
            </div>
            </span>
            <Button variant="outline-dark" size="lg"><span>Let's Connect</span></Button>{' '}

        </Navbar.Collapse>
      </Container>
    </Navbar>
    </>
  );
}

export default App;
